import React from 'react'
import { useHistory } from "react-router-dom";

export default function Login() {

    const handleLogin = () => {
        useHistory().push('/profile');
    }
    return (
        <div>
            login here
            <button onClick={() => handleLogin()}>
                Login
            </button>
        </div>
    )
}
